			'https://samples.clarifai.com/face-det.jpg').then(
				function(response) {

				},
				function(err){

				}
			);
	}

	render(){
	  return (
	    <div className="App">
	    	<Particles className='particles' params={particlesOptions}/>
	    	<Navigation />
			<Logo />
			<Rank />
	    	<ImageLinkForm 
	    		onInputChange = {this.onInputChange}
	    		onButtonSubmit = {this.onButtonSubmit}
	    	/>
			{/*   
	    	<FaceRecognition /> */}
	    </div>
	  );
	 }
}

export default App;
